import React from "react";
import { Routes, Route } from 'react-router-dom';
import HomeForm from './HomeForm'



 function nothing() {
    return(
        <AppProvider>
        
            <Routes>
            <Route path='/api/verifierUser' element={<HomeForm/>}>


            </Route>
            </Routes>
        </AppProvider>
     

    )

}

export default nothing;
